INSERT INTO "public"."gaode_residential_region" VALUES ('B023B04APL', '330100', '120.173761,30.282458;120.173627,30.282464;120.17359,30.283168;120.172951,30.283179;120.172951,30.283398;120.172991,30.283673;120.173021,30.283882;120.173012,30.283964;120.173545,30.283941;120.173562,30.284265;120.17511,30.284259;120.175127,30.282579;120.174617,30.282525;120.173932,30.282467;120.173761,30.282458', '润和紫庭花园', '杭州市下城区文晖街道文晖路126号', '杭州市', '', '28735.7341', '120.174185,30.283414', '商务住宅;住宅区;住宅小区', '', '2.5', '2.82平方米', '40687', '紫庭花园位于武林商贸圈,文晖路尊贵地段,尊享全城配套精粹。创新高层围合式建筑,由8幢高层、小高层住宅围合而建,总建筑面积达9万余平方米,风格恢弘大气。现代城市风格建筑,精致典雅的立面处理,强调细节表现。  紫庭花园以3室2厅2卫、4室2厅2卫的舒适型户型为主,面积在130-170平方米之间。小区西依上塘河,绿地率达35%,实际可享用绿地2万余方,近10000平方米的中心庭院景观,河景、园景、市景,移步换景。', '2005-06-24', '1元/月/平方米');
