INSERT INTO "public"."gaode_residential_region" VALUES ('B023B064U2', '330100', '120.130065,30.276788;120.130112,30.276086;120.130351,30.276095;120.1306,30.276107;120.130879,30.276123;120.130855,30.276452;120.13083,30.276825;120.130065,30.276788', '华门世家', '杭州市西湖区文三路383号', '杭州市', '0103000020E61000000100000008000000AC5626FC52085E40DDEC0F94DB463E404C3448C153085E402AE27492AD463E400F80B8AB57085E40D1967329AE463E40E3361AC05B085E405932C7F2AE463E40EC2E505260085E4064AC36FFAF463E402861A6ED5F085E40EEE9EA8EC5463E407CD5CA845F085E4017B7D100DE463E40AC5626FC52085E40DDEC0F94DB463E40', '4918.562652', '120.130471,30.276455', '商务住宅;住宅区;住宅小区', '0.5', 'None', '200000平方米', '25048', '共3幢小高层。华门世家地处西湖区文三路电子街(九莲新村)的繁华地段,周围各样配套设施齐全,闹市不闹。小区里保全及卫生措施良好,确为商务办公之。交通亦便利,楼下即是九莲新村站,有多路公交车通往各处。', '', '1.8元/月/平方米');
